import { useState } from "react";
import BlockContainer from "./BlockContainer";
import Header from "./Header";
import "./style.css";

function App() {
  const [blocks, setBlocks] = useState([]);
  return (
    <div className="App">
      <Header />
      <BlockContainer blocks={blocks} />
    </div>
  );
}

export default App;
